import React from 'react';
import ReactDom from 'react-dom';
import{
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import App from './App';
import Redirect from './components/Redirect';
import Homepage from './pages/Homepage';
import Contact from './pages/Contact';
import Accomodations from './pages/Accomodations';
import SignIn from './pages/Signin';
import CardSpecific from './pages/CardSpec';
import AdminSidebar from './pages/Admin';
import AddEst from './pages/AddEst';
import Enquiry from './pages/Enquiry';
import AdminContact from './pages/AdminContact';
import Settings from './pages/Settings';

ReactDom.render(
  <Router>
        <App>
          <Switch>
              <Route path="/" exact component={Homepage} />
              <Route path="/accomodations" exact component={Accomodations} />
              <Route path="/contact" exact component={Contact} />
              <Route path="/signin" exact component={SignIn} /> 
              <Route path="/CardSpec" exact component={CardSpecific} />
              <Route path="/Admin" exact component={AdminSidebar} />
              <Route path="/AddEst" exact component={AddEst} />
              <Route path="/Enquiry" exact component={Enquiry} />
              <Route path="/AdminContact" exact component={AdminContact} />
              <Route path="/Settings" exact component={S} />
              <Route path='/faceb'render={(props) => <Redirect {...props} loc="https://www.facebook.com" />} />  
              <Route path='/twitte'render={(props) => <Redirect {...props} loc="https://www.twitter.com" />} />
              <Route path='/instag'render={(props) => <Redirect {...props} loc="https://www.instagram.com" />} />  
              <Route path='/tripm'render={(props) => <Redirect {...props} loc="https://www.tripadvisor.com" />} />          
          </Switch>
        </App>
  </Router>,
      document.getElementById('root')

);
